import React, { Component, Fragment } from "react";
import { LABEL_LIST as DataHeader } from "../utils/tableConstants";
import Table from '../Table';
import DataGrid from '../Datagrid';
import { tableConstants } from '../utils/tableConstants';
import { } from '../utils/DataTableHeader'
import { LABEL_LIST as DataTableHeader } from './util/DataTableHeader';
export default class View extends Component {
  constructor(props) {
    super(props);
    this.state = {
      returnList: [],
      searchString: '',
    }
  }

  componentDidMount() {
    this.props.setHeader("ReturnList");
    this.getReturnList();
  }

  getReturnList = () => {
    this.props.ajaxUtil.sendRequest(
      this.props.url_Inventory.RETURN_FILE_LIST_URL,
      {},
      (response) => {
        if (!response.status) {
          this.props.setNotification({
            message: response.message,
            hasError: response.status,
            timestamp: new Date().getTime()
          });
        } else {
          if (response.hasOwnProperty('data')) {
            this.setState({ returnList: response.data.content })
            console.log(response.data.content)
          }
        }
      },
      this.props.loadingFunction,
      { method: 'GET', isShowSuccess: false }
    );
  }

  handleChange = (event) => {
    if (event.currentTarget.value.length <= 0) {
      this.getReturnList();
    }
    this.setState({ [event.currentTarget.name]: event.currentTarget.value });
  }
  onSearch = () => {
    const url = this.props.url_Inventory.RETURN_FILE_SEARCH_URL;
    this.props.ajaxUtil.sendRequest(
      url,
      [{
        "booleanValue": true,
        "fromDate": null,
        "key": "iccid",
        "toDate": null,
        "value": this.state.searchString
      }],
      (response) => {
        if (!response.status) {
          this.props.setNotification({
            message: response.message,
            hasError: response.status,
            timestamp: new Date().getTime()
          });
        } else {
          if (response.hasOwnProperty('data')) {
            this.setState({ returnList: response.data.content })
          }
        }
      },
      this.props.loadingFunction,
      { method: 'POST', isShowSuccess: false }
    );
  }

  render() {
    const handleEdit = (item) => () => {
      // write your logic
      alert(JSON.stringify(item))
    }
    const {
      returnList
    } = this.state;
    return (
      <div className="container-fluid">
        <div className="tab__fileter__content">
          <div className="tab__filter__left pl-0">
            <div className="all__entries">
              All Entries | <span>{(this.state.returnList.length).toString().padStart(2, '0')}</span>
            </div>
            <h4>Return file</h4>
          </div>
          <div className="tab__filter__right pl-0">
            <div className="form__wrapper">
              <div className="search__form">
                <input
                  type="text"
                  name="searchString"
                  placeholder="Search"
                  value={this.state.searchString}
                  onChange={this.handleChange}
                  className="form-control border__animate"
                />
                <span className="focus-border"></span>
                <i onClick={this.onSearch} className="fa fa-search" aria-hidden="true"></i>
              </div>
              <div className="filter__button">
                <button>
                  <i className="fa fa-filter" aria-hidden="true"></i>
                </button>
              </div>
            </div>
          </div>
        </div>
        <div className="table-responsive dataTable_wrapper">
          <div className="table-responsive">
            <Table cols={tableConstants(handleEdit)} data={returnList} />
            <div class="table__fixed__footer">
              <div class="footer__left">
                <select class="custom-select">
                  <option selected>10</option>
                  <option value="1">25</option>
                  <option value="2">50</option>
                  <option value="3">100</option>
                </select>
                <label>Records Per Page</label>
              </div>
              <div class="footer__right">
                <div class="page__enter">
                  <span>page</span>
                  <input
                    type="text"
                    class="form-control"
                    value="1"
                  />
                  <span>of 1115</span>
                </div>

                <nav aria-label="Page navigation">
                  <ul class="pagination">
                    <li class="page-item">
                      <a class="page-link" href="#">First</a>
                    </li>
                    <li class="page-item">
                      <a class="page-link" href="#">Prev</a>
                    </li>
                    <li class="page-item active">
                      <a class="page-link" href="#">1</a>
                    </li>
                    <li class="page-item">
                      <a class="page-link" href="#">2</a>
                    </li>
                    <li class="page-item">
                      <a class="page-link" href="#">Next</a>
                    </li>
                    <li class="page-item">
                      <a class="page-link" href="#">Last</a>
                    </li>
                  </ul>
                </nav>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
